import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Navbar from './Components/Navbar';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
function App() {
  return (
    <>
    <Router>
      <Switch>
      <Route path={"/"}/>
       <Navbar></Navbar>
       </Switch>
    </Router>
    </>
  );
}

export default App;
